ifts, non-liquid securities, and contributions whose sources are not transparent or whose use is restricted in some manner, must be reviewed prior to acceptance due to the special obligations raised or liabilities they may pose for LIFE.</p>\n				<p>The LIFE will provide acknowledgments to donors meeting tax requirements for property received by the charity as a gift. However, except for gifts of cash and publicly traded securities, no value shall be ascribed to any receipt or other form of substantiation of a gift received by LIFE.</p>\n				<p>The LIFE will respect the intent of the donor relating to gifts for restricted purposes and those relating to the desire to remain anonymous. With respect to anonymous gifts, the LIFE will restrict information about the donor to only those staff members with a need to know.</p>\n				<p>The LIFE will not compensate, whether through commissions, finders\' fees, or other means, any third party for directing a gift or a donor to the LIFE.</p>\";s:21:\"babel_polyfill_script\";s:7:\"enabled\";s:19:\"paypal_verification\";s:7:\"enabled\";s:8:\"gateways\";a:3:{s:6:\"manual\";i:1;s:7:\"offline\";i:1;s:6:\"stripe\";i:1;}s:15:\"default_gateway\";s:6:\"manual\";s:31:\"global_offline_donation_content\";s:385:\"<p>In order to make an offline donation we ask that you please follow these instructions: </p><ol><li>Make a check payable to \"{sitename}\"</li><li>On the memo line of the check, please indicate that the donation is for \"{sitename}\"</li><li>Please mail your check to:</li></ol>{offline_mailing_address}<br><p>All contributions will be gratefully acknowledged and are tax deductible.</p>\";s:43:\"give_offline_donation_enable_billing_fields\";s:8:\"disabled\";s:23:\"donor_default_user_role\";s:10:\"give_donor\";s:42:\"offline-donation-instruction_email_message\";s:385:\"<p>In order to make an offline donation we ask that you please follow these instructions: </p><ol><li>Make a check payable to \"{sitename}\"</li><li>On the memo line o