:4:\"data\";s:69:\"https://wordpress.org/support/topic/xml-sitemap-not-working-properly/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 27 Feb 2020 16:40:47 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1509:\"\n						\n						<p>Replies: 0</p>\n						<p>Hello,</p>\n<p>XML Sitemap Generator for WordPress plugin has been installed on my site for a very long time&#8230;I do have 4.1.0 installed on my site (I believe version 4.1.0 is the latest version)&#8230;but I&#8217;m not sure it&#8217;s working properly currently.  The XML Sitemap Plugin is enabled.</p>\n<ul>\nHere are a few examples:</ul>\n<p>1.  If I click on ANY of the &#8220;About this Plugin&#8221; links&#8230;this is the URL it&#8217;s pointing to (and never connects): </p>\n<p><a href=\"https://8rkh4sskhh.execute-api.us-east-1.amazonaws.com/gsg/v1/sitemap-home\" rel=\"nofollow\">https://8rkh4sskhh.execute-api.us-east-1.amazonaws.com/gsg/v1/sitemap-home</a></p>\n<p>But if I do a Google search for XML Sitemap for WordPress&#8230;this is the proper URL for XML Sitemap :</p>\n<p><a href=\"https://www.arnebrachhold.de/projects/wordpress-plugins/google-xml-sitemaps-generator/\" rel=\"nofollow\">https://www.arnebrachhold.de/projects/wordpress-plugins/google-xml-sitemaps-generator/</a></p>\n<p>2.  Within the XML Sitemap settings it says &#8220;<strong>Result of the last ping, started on January 14, 2016 4:00 pm.</strong>&#8220;.  This seems kinda old to me&#8230;wasn&#8217;t sure if this is supposed to be the last date when a sitemap was generated.</p>\n<p>3.  I can&#8217;t seem to find any sitemap.xml file in my websites server directory.</p>\n<p>Please let me know what&#8217;s up&#8230;would really like to get this fixed.</p>\n<p>Thanks much.</p>\n						\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"alfuzzy\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:67:\"\n					\n					\n					\n					\n					\n\n					\n					\n\n					\n					\n					\n				\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://wordpress.org/support/topic/bug-with-include-a-xslt-stylesheet-option/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"Bug with Include a XSLT stylesheet option\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://wordpress.org/support/topic/bug-with-include-a-xslt-stylesheet-option/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 22 Feb 2020 22:49:38 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:613:\"\n						\n						<p>Replies: 0</p>\n						<p>Hello,</p>\n<p>Thanks for this plugin!</p>\n<p>There is a bug with the option &#8220;Include a XSLT stylesheet&#8221;, where a trailing slash always is added to the specified URL. For example, if I try to enter this:</p>\n<p><code>/path/sitemap.xsl</code></p>\n<p>The plugin adds a trailing slash, so the URL is incorrect:</p>\n<p><code>/path/sitemap.xsl/</code></p>\n<p>This causes errors with Chrome and other browsers, such that the sitemap is not displayed (blank page) and other issues.</p>\n<p>Let me know if I can provide any other infos.</p>\n<p>Thank you</p>\n						\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Jeff Starr\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:67:\"\n					\n					\n					\n					\n					\n\n					\n					\n\n					\n					\n					\n				\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://wordpress.org/support/topic/multisite-554/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"multisite\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://wordpress.org/support/topic/multisite-554/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 20 Feb 2020 17:50:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:210:\"\n						\n						<p>Replies: 0</p>\n						<p>Hello, I have a multisite. Should I do a network activation of your plugin or not?<br />\nShould I have 2 sitemaps or only one?<br />\nthank you!<br />\nA.</p>\n						\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"romeing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:67:\"\n					\n					\n					\n					\n					\n\n					\n					\n\n					\n					\n					\n				\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"https://wordpress.org/support/topic/sitemap-error-soft-404/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"Sitemap Error Soft 404\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"https://wordpress.org/support/topic/sitemap-error-soft-404/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 19 Feb 2020 18:12:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:182:\"\n						\n						<p>Replies: 2</p>\n						<p>Google says there is a problem with the sitemp.xml, but does not indicate a fix.</p>\n<p>Submitted URL seems to be a Soft 404</p>\n						\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"eweneek1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:67:\"\n					\n					\n					\n					\n					\n\n					\n					\n\n					\n					\n					\n				\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://wordpress.org/support/topic/multiple-problems-in-sitemap/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"Multiple problems in sitemap\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://wordpress.org/support/topic/multiple-problems-in-sitemap/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 18 Feb 2020 09:55:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2751:\"\n						\n						<p>Replies: 1</p>\n						<p>Hello,</p>\n<p>I have several problems with the site map generated for this site, as well as with the plugin itself.</p>\n<p>First of all, please note that there is a site map for each language:<br />\n<a href=\"https://www.textile-du-maine.com/sitemap.xml\" rel=\"nofollow\">https://www.textile-du-maine.com/sitemap.xml</a><br />\n<a href=\"https://www.textile-du-maine.com/en/sitemap.xml\" rel=\"nofollow\">https://www.textile-du-maine.com/en/sitemap.xml</a></p>\n<p>1. Duplicate page listings</p>\n<p>All pages are listed twice in each site map. Google shows the French site having 39 pages and the English site having 38 pages, though each site has about half the number of pages.</p>\n<p>2. Strange structure of site map (and illogical placement of double pages)</p>\n<p>I don&#8217;t understand the logic behind the site map sub-pages. It doesn&#8217;t correspond to the structure of the site. Also, underneath different sub-pages of the site map, you find duplicates of the pages, but this is not consistently done. For example, the page &#8220;<a href=\"https://www.textile-du-maine.com/mentions_legales/&#038;#8221\" rel=\"nofollow\">https://www.textile-du-maine.com/mentions_legales/&#038;#8221</a>; is doubled WITHIN the &#8220;01&#8221; sub-page. On the other hand, the doubles for the &#8220;contact&#8221; page are found in two different sub-pages (&#8220;11&#8221; and &#8220;03&#8221;). Here is the structure of the sub-pages of the site map:</p>\n<p>URL of sub-sitemap	Last modified (GMT)<br />\n<a href=\"https://www.textile-du-maine.com/sitemap-misc.xml\" rel=\"nofollow\">https://www.textile-du-maine.com/sitemap-misc.xml</a>	2020-02-16 15:08<br />\n<a href=\"https://www.textile-du-maine.com/sitemap-pt-page-2020-01.xml\" rel=\"nofollow\">https://www.textile-du-maine.com/sitemap-pt-page-2020-01.xml</a>	2020-02-08 14:09<br />\n<a href=\"https://www.textile-du-maine.com/sitemap-pt-page-2019-11.xml\" rel=\"nofollow\">https://www.textile-du-maine.com/sitemap-pt-page-2019-11.xml</a>	2020-02-16 15:08<br />\n<a href=\"https://www.textile-du-maine.com/sitemap-pt-page-2019-09.xml\" rel=\"nofollow\">https://www.textile-du-maine.com/sitemap-pt-page-2019-09.xml</a>	2020-02-16 09:24<br />\n<a href=\"https://www.textile-du-maine.com/sitemap-pt-page-2018-03.xml\" rel=\"nofollow\">https://www.textile-du-maine.com/sitemap-pt-page-2018-03.xml</a>	2020-02-06 23:29</p>\n<p>3. Problems with Links on Plugin Settings page</p>\n<p>On the plugin settings page, all the links are broken underneath the titles, &#8220;About this plugin&#8221; and &#8220;Sitemap Resources.&#8221;</p>\n<p>Details of installation:<br />\n&#8211; WordPress 5.3.2 running Bridge theme.<br />\n&#8211; Plugin Version 4.1.0</p>\n<p>Best regards,</p>\n<p>Robert</p>\n						\n					\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"rreedmeister\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:67:\"\n					\n					\n				