INSERT INTO `hkx_posts` VALUES (2,1,'2019-09-28 00:34:12','2019-09-27 15:34:12','<!-- wp:paragraph -->\r\n<p>これはサンプルページです。同じ位置に固定され、(多くのテーマでは) サイトナビゲーションメニューに含まれる点がブログ投稿とは異なります。まずは、サイト訪問者に対して自分のことを説明する自己紹介ページを作成するのが一般的です。たとえば以下のようなものです。</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:quote -->\r\n<blockquote class=\"wp-block-quote\"><p>はじめまして。昼間はバイク便のメッセンジャーとして働いていますが、俳優志望でもあります。これは僕のサイトです。ロサンゼルスに住み、ジャックという名前のかわいい犬を飼っています。好きなものはピニャコラーダ、そして通り雨に濡れること。</p></blockquote>\r\n<!-- /wp:quote -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>または、このようなものです。</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:quote -->\r\n<blockquote class=\"wp-block-quote\"><p>XYZ 小道具株式会社は1971年の創立以来、高品質の小道具を皆様にご提供させていただいています。ゴッサム・シティに所在する当社では2,000名以上の社員が働いており、様々な形で地域のコミュニティへ貢献しています。</p></blockquote>\r\n<!-- /wp:quote -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>新しく WordPress ユーザーになった方は、<a href=\"https://hkx.monster/wp-admin/\">ダッシュボード</a>へ行ってこのページを削除し、独自のコンテンツを含む新しいページを作成してください。それでは、お楽しみください !</p>\r\n<!-- /wp:paragraph -->','サンプルページ','','publish','closed','open','','sample-page','','','2019-12-24 14:29:07','2019-12-24 05:29:07','',0,'https://hkx.monster/?page_id=2',0,'page','',0),(3,1,'2019-09-28 00:34:12','2019-09-27 15:34:12','<!-- wp:heading --><h2>私たちについて</h2><!-- /wp:heading --><!-- wp:paragraph --><p>私たちのサイトアドレスは https://hkx.monster です。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>このサイトが収集する個人データと収集の理由</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>コメント</h3><!-- /wp:heading --><!-- wp:paragraph --><p>訪問者がこのサイトにコメントを残す際、コメントフォームに表示されているデータ、そしてスパム検出に役立てるための IP アドレスとブラウザーユーザーエージェント文字列を収集します。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>メールアドレスから作成される匿名化された (「ハッシュ」とも呼ばれる) 文字列は、あなたが Gravatar サービスを使用中かどうか確認するため同サービスに提供されることがあります。同サービスのプライバシーポリシーは https://automattic.com/privacy/ にあります。コメントが承認されると、プロフィール画像がコメントとともに一般公開されます。</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>メディア</h3><!-- /wp:heading --><!-- wp:paragraph --><p>サイトに画像をアップロードする際、位置情報 (EXIF GPS) を含む画像をアップロードするべきではありません。サイトの訪問者は、サイトから画像をダウンロードして位置データを抽出することができます。</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>お問い合わせフォーム</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookie</h3><!-- /wp:heading --><!-- wp:paragraph --><p>サイトにコメントを残す際、お名前、メールアドレス、サイトを Cookie に保存することにオプトインできます。これはあなたの便宜のためであり、他のコメントを残す際に詳細情報を再入力する手間を省きます。この Cookie は1年間保持されます。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>ログインページを訪問すると、お使いのブラウザーが Cookie を受け入れられるかを判断するために一時 Cookie を設定します。この Cookie は個人データを含んでおらず、ブラウザーを閉じると廃棄されます。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>ログインの際さらに、ログイン情報と画面表示情報を保持するため、私たちはいくつかの Cookie を設定します。ログイン Cookie は2日間、画面表示オプション Cookie は1年間保持されます。「ログイン状態を保存する」を選択した場合、ログイン情報は2週間維持されます。ログアウトするとログイン Cookie は消去されます。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>もし投稿を編集または公開すると、さらなる Cookie がブラウザーに保存されます。この Cookie は個人データを含まず、単に変更した投稿の ID を示すものです。1日で有効期限が切れます。</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>他サイトからの埋め込みコンテンツ</h3><!-- /wp:heading --><!-- wp:paragraph --><p>このサイトの投稿には埋め込みコンテンツ (動画、画像、投稿など) が含まれます。他サイトからの埋め込みコンテンツは、訪問者がそのサイトを訪れた場合とまったく同じように振る舞います。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>これらのサイトは、あなたのデータの収集、Cookie の使用、サードパーティによる追加トラッキングの埋め込み、埋め込みコンテンツとのやりとりの監視を行うことがあります。アカウントを使ってそのサイトにログイン中の場合、埋め込みコンテンツとのやりとりのトラッキングも含まれます。</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>アナリティクス</h3><!-- /wp:heading --><!-- wp:heading --><h2>あなたのデータの共有先</h2><!-- /wp:heading --><!-- wp:heading --><h2>データを保存する期間</h2><!-- /wp:heading --><!-- wp:paragraph --><p>あなたがコメントを残すと、コメントとそのメタデータが無期限に保持されます。これは、モデレーションキューにコメントを保持しておく代わりに、フォローアップのコメントを自動的に認識し承認できるようにするためです。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>このサイトに登録したユーザーがいる場合、その方がユーザープロフィールページで提供した個人情報を保存します。すべてのユーザーは自分の個人情報を表示、編集、削除することができます (ただしユーザー名は変更することができません)。サイト管理者もそれらの情報を表示、編集できます。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>データに対するあなたの権利</h2><!-- /wp:heading --><!-- wp:paragraph --><p>このサイトのアカウントを持っているか、サイトにコメントを残したことがある場合、私たちが保持するあなたについての個人データ (提供したすべてのデータを含む) をエクスポートファイルとして受け取るリクエストを行うことができます。また、個人データの消去リクエストを行うこともできます。これには、管理、法律、セキュリティ目的のために保持する義務があるデータは含まれません。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>あなたのデータの送信先</h2><!-- /wp:heading --><!-- wp:paragraph --><p>訪問者によるコメントは、自動スパム検出サービスを通じて確認を行う場合があります。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>あなたの連絡先情報</h2><!-- /wp:heading --><!-- wp:heading --><h2>追加情報</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>データの保護方法</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>データ漏洩対策手順</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>データ送信元のサードパーティ</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>ユーザーデータに対して行う自動的な意思決定およびプロファイリング</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>業界規制の開示要件</h3><!-- /wp:heading -->','プライバシーポリシー','','draft','closed','open','','privacy-policy','','','2019-09-28 00:34:12','2019-09-27 15:34:12','',0,'https://hkx.monster/?page_id=3',0,'page','',0),(5,1,'2019-09-28 01:30:03','2019-09-27 16:30:03','<!-- wp:amp/amp-story-page {\"mediaType\":\"image\",\"focalPoint\":{\"x\":0.48484848484848486,\"y\":0.47058823529411764},\"autoAdvanceAfterDuration\":0,\"backgroundColors\":\"[{\\u0022color\\u0022:\\u0022#313131\\u0022},{\\u0022color\\u0022:null}]\",\"overlayOpacity\":80} -->\n<amp-story-page style=\"background-color:#ffffff\" id=\"a98f0f68-263a-49f1-92c9-6b5259507c3f\" class=\"wp-block-amp-amp-story-page\"><amp-story-grid-layer template=\"fill\"><img layout=\"fill\" src=\"https://hkx.monster/wp-content/plugins/amp/assets/images/stories-editor/story-templates/travel-tip.jpg\" object-position=\"48.484848484848484% 47.05882352941176%\"/></amp-story-grid-layer><amp-story-grid-layer template=\"fill\" style=\"background-image:linear-gradient(to bottom, #313131, transparent);opacity:0.8\"></amp-story-grid-layer><!-- wp:amp/amp-story-text {\"tagName\":\"h1\",\"align\":\"center\",\"customFontSize\":10,\"autoFontSize\":14,\"ampFitText\":false,\"customTextColor\":\"#ffffff\",\"customBackgroundColor\":\"#8c58e3\",\"height\":45,\"width\":40,\"className\":\"amp-text-content has-text-color has-background is-style-half-rounded\",\"positionTop\":8,\"positionLeft\":43} -->\n    <h1 style=\"background-color:rgba(140, 88, 227, 1);color:#ffffff;font-size:3.05vw;text-align:center\" class=\"wp-block-amp-amp-story-text amp-text-content has-text-color has-background is-style-half-rounded\">TIP<br>01</h1>\n    <!-- /wp:amp/amp-story-text -->\n\n    <!-- wp:amp/amp-story-text {\"tagName\":\"h2\",\"align\":\"center\",\"customFontSize\":24,\"autoFontSize\":44,\"ampFitText\":false,\"customTextColor\":\"#ffffff\",\"height\":79,\"width\":267,\"positionTop\":20,\"positionLeft\":11} -->\n    <h2 style=\"color:#ffffff;font-size:7.32vw;text-align:center\" class=\"wp-block-amp-amp-story-text amp-text-content has-text-color\">This template is great for sharing tips.</h2>\n    <!-- /wp:amp/amp-story-text --></amp-story-page>\n<!-- /wp:amp/amp-story-page -->\n','Template: Travel Tip','','publish','closed','closed','','travel-tip','','','2019-09-28 01:30:03','2019-09-27 16:30:03','',0,'https://hkx.monster/2019/09/28/travel-tip/',0,'wp_block','',0),(6,1,'2019-09-28 01:30:03','2019-09-27 16:30:03','<!-- wp:amp/amp-story-page {\"mediaType\":\"image\",\"autoAdvanceAfterDuration\":0,\"backgroundColors\":\"[{\\u0022color\\u0022:\\u0022#8c58e3\\u0022},{\\u0022color\\u0022:\\u0022#fff9e5\\u0022}]\",\"overlayOpacity\":50} -->\n<amp-story-page style=\"background-color:#ffffff\" id=\"5da957b0-ee47-4f6c-9eff-79dd82e13f26\" class=\"wp-block-amp-amp-story-page\"><amp-story-grid-layer template=\"fill\"><img layout=\"fill\" src=\"https://hkx.monster/wp-content/plugins/amp/assets/images/stories-editor/story-templates/quote-bg.jpg\" object-position=\"initial\"/></amp-story-grid-layer><amp-story-grid-layer template=\"fill\" style=\"background-image:linear-gradient(to bottom, #8c58e3, #fff9e5);opacity:0.5\"></amp-story-grid-layer>\n\n    <!-- wp:image {\"width\":322,\"height\":200,\"positionTop\":63.29,\"positionLeft\":0.91} -->\n    <figure class=\"wp-block-image is-resized\"><img src=\"https://hkx.monster/wp-content/plugins/amp/assets/images/stories-editor/story-templates/quote-image.png\" alt=\"\" width=\"322\" height=\"200\"/></figure>\n    <!-- /wp:image -->\n\n    <!-- wp:quote {\"width\":328,\"align\":\"center\",\"className\":\"wp-block-quote is-style-white\",\"positionTop\":8,\"positionLeft\":0} -->\n    <blockquote class=\"wp-block-quote has-text-align-center is-style-white\"><p>Everyone soon or late comes round Rome</p><cite>Robert Browning</cite></blockquote>\n    <!-- /wp:quote --></amp-story-page>\n<!-- /wp:amp/amp-story-page -->\n','Template: Quote','','publish','closed','closed','','quote','','','2019-09-28 01:30:03','2019-09-27 16:30:03','',0,'https://hkx.monster/2019/09/28/quote/',0,'wp_block','',0),(7,1,'2019-09-28 01:30:03','2019-09-27 16:30:03','<!-- wp:amp/amp-story-page {\"mediaType\":\"image\",\"autoAdvanceAfterDuration\":0,\"backgroundColors\":\"[{\\u0022color\\u0022:\\u0022#8c58e3\\u0022},{\\u0022color\\u0022:\\u0022#fff9e5\\u0022}]\",\"overlayOpacity\":50} -->\n<amp-story-page style=\"background-color:#ffffff\" id=\"4c4ad30d-0662-4860-a0d2-765843911c47\" class=\"wp-block-amp-amp-story-page\"><amp-story-grid-layer template=\"fill\"><img layout=\"fill\" src=\"https://hkx.monster/wp-content/plugins/amp/assets/images/stories-editor/story-templates/cta-bg.jpg\" object-position=\"initial\"/></amp-story-grid-layer><amp-story-grid-layer template=\"fill\" style=\"background-image:linear-gradient(to bottom, #8c58e3, #fff9e5);opacity:0.5\"></amp-story-grid-layer>\n    <!-- wp:image {\"width\":261,\"height\":195,\"className\":\"wp-block-image is-resized is-style-rounded\",\"positionTop\":38,\"positionLeft\":12} -->\n    <figure class=\"wp-block-image is-resized is-style-rounded\"><img src=\"https://hkx.monster/wp-content/plugins/amp/assets/images/stories-editor/story-templates/cta-image.jpg\" alt=\"\" width=\"261\" height=\"195\"/></figure>\n    <!-- /wp:image -->\n\n    <!-- wp:amp/amp-story-text {\"tagName\":\"h2\",\"align\":\"center\",\"customFontSize\":24,\"autoFontSize\":22,\"ampFitText\":false,\"customTextColor\":\"#ffffff\",\"height\":66,\"width\":275,\"positionTop\":19,\"positionLeft\":9} -->\n    <h2 style=\"color:#ffffff;font-size:7.32vw;text-align:center\" class=\"wp-block-amp-amp-story-text amp-text-content has-text-color\">The Ultimate Packing List for Italy</h2>\n    <!-- /wp:amp/amp-story-text -->\n\n    <!-- wp:amp/amp-story-text {\"type\":\"p\",\"tagName\":\"h1\",\"align\":\"center\",\"fontSize\":\"normal\",\"autoFontSize\":26,\"ampFitText\":false,\"ampFontFamily\":\"Source Sans Pro\",\"customTextColor\":\"#ffffff\",\"height\":29,\"width\":296,\"positionTop\":12} -->\n    <h1 style=\"color:#ffffff;font-size:4.88vw;text-align:center\" class=\"wp-block-amp-amp-story-text amp-text-content has-text-color\" data-font-family=\"Source Sans Pro\">Traveling to Italy soon?</h1>\n    <!-- /wp:amp/amp-story-text -->\n\n    <!-- wp:amp/amp-story-cta {\"customBackgroundColor\":\"#ffffff\",\"customTextColor\":\"#8c58e3\",\"fontSize\":\"normal\",\"btnPositionLeft\":12.51} -->\n    <amp-story-cta-layer class=\"wp-block-amp-amp-story-cta\" id=\"1dc9e3e7-c8e4-407c-af26-f543ad7f941a\"><a class=\"amp-block-story-cta__link amp-text-content has-text-color has-background\" href=\"\" style=\"background-color:rgba(255, 255, 255, 1);color:#8c58e3;font-size:4.88vw;left:12.51%\"><strong>Show packing tips</strong></a></amp-story-cta-layer>\n    <!-- /wp:amp/amp-story-cta --></amp-story-page>\n<!-- /wp:amp/amp-story-page -->\n','Template: Travel CTA','','publish','closed','closed','','travel-cta','','','2019-09-28 01:30:03','2019-09-27 16:30:03','',0,'https://hkx.monster/2019/09/28/travel-cta/',0,'wp_block','',0),(8,1,'2019-09-28 01:30:03','2019-09-27 16:30:03','<!-- wp:amp/amp-story-page {\"mediaType\":\"image\",\"autoAdvanceAfterDuration\":0,\"backgroundColors\":\"[{},{\\u0022color\\u0022:\\u0022#313a43\\u0022}]\",\"overlayOpacity\":40} -->\n<amp-story-page style=\"background-color:#ffffff\" id=\"24dd0b58-9125-47ce-ad42-c2a80c2eeb3a\" class=\"wp-block-amp-amp-story-page\"><amp-story-grid-layer template=\"fill\"><img layout=\"fill\" src=\"https://hkx.monster/wp-content/plugins/amp/assets/images/stories-editor/story-templates/title-bg.jpg\" object-position=\"initial\"/></amp-story-grid-layer><amp-story-grid-layer template=\"fill\" style=\"background-image:linear-gradient(to bottom, transparent, #313a43);opacity:0.4\"></amp-story-grid-layer>\n	<!-- wp:amp/amp-story-text {\"type\":\"p\",\"customTextColor\":\"#ffffff\",\"customBackgroundColor\":\"#8c58e3\",\"autoFontSize\":10,\"opacity\":80,\"positionTop\":59,\"positionLeft\":6,\"height\":20,\"width\":111,\"className\":\"is-style-rounded\"} -->\n	<p style=\"background-color:rgba(140, 88, 227, 0.8);color:#ffffff;display:flex\" class=\"wp-block-amp-amp-story-text has-text-color has-background is-style-rounded\"><amp-fit-text layout=\"flex-item\" class=\"amp-text-content\">Travel Tips</amp-fit-text></p>\n    <!-- /wp:amp/amp-story-text -->\n\n	<!-- wp:amp/amp-story-post-title {\"align\":\"left\",\"customFontSize\":28,\"autoFontSize\":26,\"ampFontFamily\":\"Source Sans Pro\",\"customTextColor\":\"#ffffff\",\"height\":80,\"width\":294,\"positionTop\":68,\"positionLeft\":6} -->\n	<h1 style=\"color:#ffffff;text-align:left\" class=\"wp-block-amp-amp-story-post-title has-text-color\" data-font-family=\"Source Sans Pro\"><amp-fit-text layout=\"flex-item\" class=\"amp-text-content\">{content}</amp-fit-text></h1>\n	<!-- /wp:amp/amp-story-post-title -->\n\n	<!-- wp:amp/amp-story-post-author {\"customFontSize\":12,\"autoFontSize\":14,\"ampFontFamily\":\"Source Sans Pro\",\"customTextColor\":\"#ffffff\",\"height\":20,\"width\":70,\"positionTop\":87,\"positionLeft\":6} -->\n	<div style=\"color:#ffffff\" class=\"wp-block-amp-amp-story-post-author has-text-color\" data-font-family=\"Source Sans Pro\"><amp-fit-text layout=\"flex-item\" class=\"amp-text-content\">{content}</amp-fit-text><