n></span><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">。</span></span></span></span></span></span><br />\r\n<span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">あれからずっと的Skype年日本语を教えられました。2018年3月26日，インタンとして福冈に行き，やっと生きてる佐多先生と会いました。</span></span></span></span></span></span><br />\r\n<span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">先生はずっと福冈で勤务してて，私が入社した后の日本语レッスン</span></span></span></span></span></span><br />\r\n<span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">のの</span></span></span></span></span><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">天空</span></span></span></span></span><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">齢が齢が</span></span></span></span></span><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">取りしていました，残念だった。</span></span></span></span></span><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">先生の年齢が分らないので</span></span></span><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">，本体は80歳のおばあちゃんかもしれないけど</span></span></span><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">，とてもきれい日本。</span></span></span></span></span></span><br />\r\n<span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">先生にすごく印象が深くて</span></span></span><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">，原因は私と日本语で会话する最初の人だったかな，颜がきれいは一番の原因もかもしれません。</span></span></span></span></span></span></p>','佐多　仁美','','private','open','open','','hitomi','','','2020-03-03 15:24:00','2020-03-03 06:24:00','',0,'https://hkx.monster/?p=176',0,'post','',0),(177,1,'2020-01-16 17:12:18','2020-01-16 08:12:18','[{\"term_slug\":\"461fce7fecc4fd0e363df594a43ff7e7\",\"data\":{\"node_name\":\"script\",\"parent_name\":\"head\",\"code\":\"invalid_element\",\"type\":\"js_error\",\"node_attributes\":{\"src\":\"https:\\/\\/hkx.monster\\/wp-includes\\/js\\/jquery\\/jquery.js?ver=__normalized__\"},\"sources\":[{\"type\":\"core\",\"name\":\"wp-includes\",\"file\":\"script-loader.php\",\"line\":2618,\"function\":\"wp_print_head_scripts\",\"hook\":\"wp_head\",\"priority\":9}]}},{\"term_slug\":\"6bb2932ded4beaaf2a6f128934daecdb\",\"data\":{\"node_name\":\"script\",\"parent_name\":\"head\",\"code\":\"invalid_element\",\"type\":\"js_error\",\"node_attributes\":{\"src\":\"https:\\/\\/hkx.monster\\/wp-includes\\/js\\/jquery\\/jquery-migrate.min.js?ve