 inherit;\">初対面は2017年10月大学で面接する时ですが</span><span style=\"vertical-align: inherit;\">，あの时が紧张すぎで，あまり先生のことを见てなかった</span><span style=\"vertical-align: inherit;\">。</span></span><br />\r\n<span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">あれからずっと的Skypeで日本语を教えられました。2018年3月26日，インタンとして福冈に行き，やっと生きてる佐多先生と会いました。</span></span><br />\r\n<span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">先生はずっと福冈で勤务してて，私が入社した后の日本语レッスン</span></span><br />\r\n<span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">のの</span><span style=\"vertical-align: inherit;\">sky </span><span style=\"vertical-align: inherit;\">齢が齢が</span><span style=\"vertical-align: inherit;\">取りしていました，残念だった。</span><span style=\"vertical-align: inherit;\">先生の年齢が分らないので，本体は80歳のおばあちゃんかもしれないけど，とてもきれい日本。</span></span><br />\r\n<span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">先生にすごく印象が深くて，原因は私と日本语で会话する最初の人だったかな，颜がきれいは一番の原因もかもしれません。</span></span></p>','佐多　仁美','','inherit','closed','closed','','176-revision-v1','','','2020-02-22 16:18:53','2020-02-22 07:18:53','',176,'https://hkx.monster/photo/176-revision-v1/',0,'revision','',0),(251,1,'2020-02-22 16:20:41','2020-02-22 07:20:41','<p><img class=\"size-medium wp-image-114\" src=\"https://hkx.monster/wp-content/uploads/2019/11/819444b271925d4cb3d68e52b3d95d4-300x225.jpg\" alt=\"\" width=\"300\" height=\"225\" /></p>\r\n<p><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">佐藤先生は私の初めての会社の日本语先生だ</span></span></span><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">。</span></span></span></span><br />\r\n<span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\"><span style=\"vertical-align: inherit;\">初対面は2017年10月大学で面接する时ですが</s